                    cy.loginAs(role);
                });
                matrix.rules.forEach(function (rule) {
                    var route = adminCfg.routes.find(function (r) { return r.key === rule.routeKey; });
                    if (!route)
                        return;
                    var isAllowed = rule.allowed.includes(role);
                    it("".concat(isAllowed ? 'ALLOWS' : 'DENIES', " access to ").concat(rule.routeKey, " (").concat(route.path, ")"), function () {
                        cy.visitAppRoute(adminCfg.baseUrlEnv, route.path);
                        if (isAllowed) {
                            cy.url().should("not.include", redirectPath);
                            // Verify a core element of the target page exists
                            cy.get("body").should("be.visible");
                        }
                        else {
                            cy.url().should("include", redirectPath);
                        }
                    });
                });
            });
        });
    });
});

